INSERT INTO `factores` (`id`, `factor`, `descripcion`) VALUES
(1, 'n_pers', 'Cantidad de personas que habitan la región afectada por el terremoto'),
(2, 'cons_con', 'Destrucción de construcciones de cemento y bloques de las edificaciones, puentes, etc.'),
(3, 'atrp_esc', 'Estar atrapado bajo escombros aumenta la probabilidad de muerte de las personas debido a las diversas lesiones o traumas no tratadas a tiempo. '),
(4, 'zon_urb', 'Zona geográfica urbana con gran cantidad de habitantes y edificaciones generalmente de concreto. '),
(5, 'cen_sal', 'Falta de centros de salud debido al derrumbamiento de este por el terremoto.'),
(6, 'norm_con', 'Ausencia de normas de construcción adecuadas para la construcción de edificaciones en zonas de alto riesgo sísmico.'),
(7, 'carr_trans', 'Destrucción de carreteras y medios de comunicación.'),
(8, 'cost_mar', 'Cercanía a la costa marítima.'),
(9, 'inst_med', 'Falta de instrumentos médicos, medicinas y especialistas para tratar las distintas enfermedades y traumas de las personas dejadas por el terremoto.'),
(10, 'terr_noc', 'Probabilidad de ocurrencia del terremoto en la noche, lo que dificulta la reacción inmediata de las personas frente a este.'),
(11, 'cond_end', 'Condiciones endémicas. Enfermedades que afectan habitualmente a una región.'),
(12, 'cont_cad', 'Probabilidad de contagio de enfermedades de las personas que entran en contacto físico con los cadáveres de las personas fallecidas.'),
(13, 'serv_bas', 'Interrupción de los servicios básicos de atención de salud.'),
(14, 'des_alim', 'Desaseo de las fuentes de alimento y agua, las cuales al ser ingeridas por las personas pueden contraer enfermedades que afectan a su salud.'),
(15, 'hac_san', 'Control del Hacinamiento y Saneamiento en albergues para refugiar a los damnificados y desplazados.'),
(16, 'lluvias', 'Las lluvias pueden provocar que las personas que han sobrevivido del terremoto y no se hayan refugiado puedan contraer resfriados u otras enfermedades por las bajas temperaturas.'),
(17, 'estc_agua', 'Estancamiento de agua que permite proliferación de insectos transmisores de enfermedades vectoriales a las personas.'),
(18, 'fam_muer', 'Alteración emocional/psicológica de las personas debido a la muerte de un familiar o alguien cercano.'),
(19, 'replicas', 'Alteración emocional/psicológica de las personas debido a estar pendientes a las múltiples réplicas que ocurren luego del terremoto.'),
(20, 'enf_pre', 'Enfermedades físicas como mentales que las personas padecían antes del terremoto.');
